import { StyleSheet, Text, View } from "react-native";
import React from "react";

const ApparelAdPage = () => {
  return (
    <View>
      <Text>apparelAdPage</Text>
    </View>
  );
};

export default ApparelAdPage;

const styles = StyleSheet.create({});
